import React from 'react';
import '../../styles/components/_Menu.scss'; // Importei meu arquivo SASS

function Menu() {
  return (
    <header>
      <nav>
        <img src="./../public/images/mangaflix.png" alt="Mangaflix logo"/>
        <ul className='nav-list'>
          <li><a href="">Inicio</a></li>
          <li><a href="">Categorias</a></li>
          <li><a href="">Sobre</a></li>
          <li><a href="">Contato</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Menu;
